import TodoItem from "./TodoItems";
import todos from "./todos.js";
import React from "react";

const TodoList = () => {
  return(
      <ul>
        {
          todos.map(todo => {
            return(
                <TodoItem todo={todo}/>);
          })
        }
      </ul>
  );
}
export default TodoList;
